  const [bajones,setBajones] = useState("")
useEffect(()=>{
axios
    .get("/prueba")
    .then((res) => res.data)
    .then((data) => {
      console.log("estoesdata", data); 
      setBajones(data)
    });
   },[])
  console.log("linea16",bajones)

  return (
    <div>
    <h1>BAJOM{bajones}</h1> 
    </div>
  );
}
